import React from "react";

class showroom extends React.Component{
    render(){
        const {showroomitems}=this.props;
        const {twowheel,fourwheel}=showroomitems;
        const workingDay=false;
        return(
            <>
            <h2>{twowheel} & {fourwheel} Showroom</h2>
             {workingDay?<h2>Showroom is Open</h2>:<h2>Showroom is Close</h2>}
            </>
        );
    }
}
export default showroom;
